import React from 'react';

import tech from '../../img/technology.png';
import media from '../../img/multimedia.png';
import address from '../../img/buildings.png';

export default (props) => {
    console.log('DETAILED PROPS: ', props);
    let contact = props.contacts[0];
    console.log('CURRENT CONTACTS IS:', contact);
    return (
        <div>
            <h2>{contact.name} {contact.lastName}</h2>
            <img src ={tech} alt='tech'/>{contact.phone} <br/>
            <img src ="../../img/multimedia.png" alt='media'/>{contact.email} <br />
            <img src ="../../img/buildings.png" alt='buildings'/>{contact.address} <br />
            <h3>Description: {contact.description}</h3>
            <button>Edit</button><button>Remove</button>
        </div>
    );
}
